Condition : 5 - The development hereby permitted shall be carried out in Phases (reference to Phases relates to any main Phase and/or Sub Phase as appropriate), as shown on Phasing Plan E1238D88115P3 - Phasing Plan - P3. Any variations to the Approved Phasing Plan shall be submitted to and approved in writing by the Local Planning Authority. 

Prior to commencement of development a programme of phasing for the implementation of the whole development site, which takes into account the timescales set out in Conditions 1 and 2,  shall be submitted to and agreed in writing by the local planning authority.  Development shall be carried out in accordance with the approved phasing programme.  The programme shall include details, where available, of the program for delivery of: 
o	Hard/soft landscaping;
o	The public open spaces;
o	Other public realm relative to each phase

Condition : 9 - Prior to commencement (Except for any works relating to demolition, site clearance, remediation) of a phase (or part therein), details of the following shall be submitted to and approved in writing by the LPA:
a)	Housing Mix and Affordable Housing Statement;
b)	BREEAM preliminary-assessment;
c)	Car Parking Details set out 
d)	Design Statement as set out 
e)	District Heating Network Assessment 
f)	Energy Strategy 
g)	Fire Strategy;
h)	Landscaping Management Plan 
i)	Lighting Strategy 
j)	Inclusive Access Strategy 
k)	Planning Statement;
l)	Statement of Community Involvement;
m)	Transport Assessment 
n)	Whole Life Carbon Assessment
o)	Floor, elevation and section plans;
p)	Details of ground floor level shopfronts (where proposed);
q)	Details of the internal space standards, unit-size mix for the residential units
r)	A minimum of 10% of the total dwellings shall be constructed as 'Wheelchair User Dwellings' built to Building Regulations M4(3) standard shall be provided. All other dwellings shall be designed so that they meet building regulation M4 (2) 'accessible and adaptable dwellings' requirements
s)	Daylight and Sunlight Report including shadow plot diagrams;
t)	Details of play space, amenity space and landscaping strategy;
u)	Details of the works to the public realm and highways, including any traffic calming measures;
v)	Updated drainage assessment form, and assessment to demonstrate compliance with principles set out in the Drainage Strategy (Ref: L19133-PPA-XX-XX-RP-C-0240, dated March 2022), Flood Risk Assessment and FRA Addendum and Drainage Assessment Form and associated drawings 
w)	Ecology; enhancement and mitigation measures, urban greening factor and Biodiversity Net Gain Calculations.

Condition : 10 - Prior to commencement of above ground works, within the relevant phase (or part therein), full details and samples of all materials to be used in the construction of the external surfaces of the development hereby permitted shall be submitted to and approved in writing by the local planning authority. Details must include a detailed schedule of materials, physical examples of materials from the manufacturer where appropriate, a photographic sample board, sample panels where appropriate and rendered drawings, elevations and sections at a sufficient scale (1:20 or 1:50) to illustrate how all external materials will appear together. Sample panels can be viewed on site where agreed.

The samples/details shall include: 

a)	Brick/stonework (including brick, stoned effect imitation materials, stone, masonry, brick panels, feature brick panel, brick framing feature and mortar on-site sample panel, minimum one metre by one metre) including all mortar colours, joint type, brick bond;
b)	Metal, metaled effect imitation materials, Cladding materials / render (including specifications where relevant);
c)	Tiles / roof covering; including parapet coping / capping materials, dormers and canopies;
d)	Window types; and sectional drawings of reveals / sills / head details 
e)	External door details
f)	Balcony and Winter Garden details (including soffits, panels and frame);
g)	Deck access and under pass design;
h)	All privacy measures (including obscure glazing details, privacy screens etc.);
i)	All balustrades and handrails (including details / sections / materials); and
j)	Any other materials/details / fittings to be used (including solar panels, extract vents, rainwater goods, external flues, details of external ventilation), with sections and on-site samples where appropriate.

The development shall then be carried out in accordance with the approved details and maintained as such thereafter.

Condition : 14 - No development shall take place within the relevant phase (or part therein) until a detailed Construction Environmental Management Plan (CEMP) has been submitted to and approved in writing by the Local Planning Authority. The CEMP shall provide details of how demolition and construction works are to be undertaken and include: 
 The identification of stages and duration of works; 
 Setting of appropriate noise criteria, trigger levels and how exceedances of those levels will be responded to by the construction contractor;
 Detailed calculation of noise and vibration of the construction phases based upon the latest and most up to date information;
 all works of demolition and construction to take place only between the hours of 08.00 and 18.00 Monday to Friday and 09.00 and 13.00 on Saturdays and at no time on Sundays or Bank/Public Holidays, unless otherwise agreed in writing;
 Procedures for maintaining good public relations including complaint management, public consultation and liaison; 
 Monitoring of construction noise levels affecting the nearest noise sensitive receptors; 
 Review and implementation of mitigation measures (as appropriate) as defined in BS 5228: Parts 1 and 2: 2009 Noise and Vibration Control on Construction and Open Sites shall be undertaken to ensure noise disturbance from construction works is minimised.  Dust suppression measure

Condition : 24 - Prior to commencement of the Phase in which Building 100 sits in its existing location, a Conservation Method Statement of Building 100 should be completed and submitted for approval to the Local Planning Authority. This should include: 
a)	An assessment of the significance and physical condition of the building's fabric; 
b)	A proposal, including timescales, for its dismantling and reconstruction, including information on storage, if this is required as part of the process; 
c)	A method statement for its reconstruction, including detailed drawings and information on materials and location. 
d)	Implementation of another suitable conservation approach to the building should the principal fabric of significance be deteriorated to such a point its relocation is no longer feasible. Once approved, the works outlined in the Conservation Method Statement shall be delivered as agreed.

Condition : 30 - Prior to commencement of above ground works within the relevant phase (or part therein) details of both hard and soft landscape works shall be submitted to and approved in writing by the local planning authority. These details shall include  
a)	a statement setting out the design objectives and how these will be delivered; 
b)	existing and proposed finished levels or contours; 
c)	means of enclosure/boundary treatment(s) and retaining structures;
d)	vehicle parking layouts; 
e)	other vehicle and pedestrian access and circulation areas;
f)	hard surfacing materials; 
g)	minor artefacts and structures (e.g. furniture, play equipment, refuse or other storage units, signs, lighting, CCTV, substation, cycle racks etc.); 
h)	proposed and existing functional services above and below ground (e.g. drainage, power, communications cables, pipelines etc. indicating alignments, levels, access points, supports as relevant); 
i)	retained historic or other landscape features and proposals for restoration, where relevant; 
j)	renewable energy installations (where relevant);
k)	planting plans, written specifications (including cultivation and other operations associated with plant and grass establishment); schedules of plants, noting species, plant sizes and proposed numbers and densities where appropriate; and
l)	an implementation and management programme (including phasing of work where relevant) detailing management responsibilities and maintenance schedules for all landscape areas, including all proposed trees, shrubs and hedgerows for the lifetime of the development. 
The landscaping works shall comply with the requirements specified in BS 3936 (1992) 'Specification of Nursery Stock Part 1 Trees and Shrubs', and in BS 4428 (1989) 'Recommendations for General Landscape Operations', and shall be carried out in accordance with the approved details before the development hereby permitted is first occupied or brought into use, or such other date(s) as may be specified in

Condition : 34 - Prior to commencement of above ground works within the relevant phase (or part therein) full details of the proposed green roofs shall have been submitted to, and approved in writing by, the Local Planning Authority, including planting schedules and maintenance and management arrangements. Details shall include: 
a)	Construction drawings to include a plan, cross sections; 
b)	Native wildflower seed mix (turf or sedum blanket will not be accepted); 
c)	Substrate between 80mm-150mm in depth; undulating and contain different materials/sizes (sand, gravel, crushed ceramic, brick, recycled, inert materials); 
d)	Small piles of untreated logs; 
e)	No permanent irrigation; 
f)	Confirmation that the green roof construction will be supervised by a suitable qualified landscape/ecology contractor
The approved details shall be implemented and retained permanently thereafter.

Condition : 35 - Prior to development in any relevant phase an Ecological Management Plan and a Habitat Management and Monitoring Plan for that phase of development shall be submitted to and approved in writing by the local planning authority.
The Ecological Management Plan shall incorporate:
(i)	details of measures to protect breeding birds, nests and eggs from mortality/damage, injury and disturbance, including avoidance by timing and/or appropriate supervision;
(ii)	details of the ecological clerk of works supervision to be put in place to monitor the clearance of vegetation to ensure no impact on undiscovered or other unexpected faunal encounters;
(iii)	an ecological lighting plan;
(iv)	details of ecological enhancement and urban greening factor, including how the urban greening factor is to be delivered and achieved on site;
(v)	details of how the enhancement measures will be monitored, managed and maintained, including the long- term design objectives, management responsibilities and maintenance schedules;
(vi)	additional detail on location and type of bird/bat boxes, maintenance and a commitment that any data collected is to be shared with the Council;
(vii)	species surveys within and around the site to demonstrate ecological enhancements

The development shall then be carried out in accordance with the approved details.
